import { AppEmbed } from "@thoughtspot/visual-embed-sdk/lib/src/react";
import "../index.css";

export default function FullApp() {
    React.useEffect(() => {
      const tsapp = new AppEmbed("#tse", {
        frameParams: {
          width: "100%",
          height: "800px",
        },
        pageId: Page.Home, 
      });
      tsapp.render();
    }, []);
    return <div id="tse" />;
  };
